        .pb-aside-right {
            position: fixed;
            top: 0;

        .pb-aside-right .aside-cot {

        .pb-aside-right .item-bottom, .pb-aside-right .item-top {

        .pb-aside-right .item-bottom > i, .pb-aside-right .item-top > i {

            cursor: pointer

        .pb-aside-right .item-bottom > p, .pb-aside-right .item-top > p {

        .pb-aside-right .item-bottom {
            position: absolute;
            bottom: 0;
            width: 100%;
            height: 100px

        .pb-aside-right .item-bottom > p {

        .pb-aside-right .qq, .pb-aside-right .weixin {

        .pb-aside-right .qq:hover .qq-hover-banner {

            -o-transition: .3s ease-out;
            transition: .3s ease-out
        }

        .pb-aside-right .qq-hover-banner:before, .pb-aside-right .weixin-img:before {
            position: absolute;
            right: -3px;
            top: 0;
            content: '';
            width: 3px;
            height: 100%

        .pb-aside-right .weixin:hover .weixin-img {
            left: -203px;
            opacity: 1

        .pb-aside-right .weixin .weixin-img {
            position: absolute;
            top: -47px;
            left: 0;
            width: 200px;
            height: 230px;
            -webkit-border-radius: 8px;
            border-radius: 8px;
            background: url(http://js.ibaotu.com/revision/img/weixin_new.png) center no-repeat;
            -webkit-background-size: 100% 100%;
            background-size: 100%;

            box-shadow: 0 0 15px rgba(0, 0, 0, .2)

        .pb-aside-right .item-top, .pb-aside-right .toTop {
            background-color: #fff;

        .pb-aside-right .nor:hover > i, .pb-aside-right .nor:hover > p, .pb-aside-right .toTop:hover > i, .pb-aside-right .toTop:hover > p {

        .pb-aside-right .company-vip {
            position: relative;
            height: 84px;
            overflow: hidden;
            border-bottom: 1px solid #fff;
            cursor: pointer;padding: 10px 0;;
        }

        .pb-aside-right .company-vip:hover .pb-mask {
            opacity: .1
        }

        .pb-aside-right .company-vip .icons-comVip {
            margin: 24px 0 9px
        }

        .pb-aside-right .company-vip > p {
            line-height: 18px;
            color: #fff;
            font-size: 12px;    margin: 0;

            text-transform: capitalize;
        }

        .pb-aside-right .company-vip .pb-mask {
            z-index: 1;
            background: #fff
        }

        .pb-aside-right .toTop {
            position: absolute;
            bottom: 2.736842%;
            width: 100%;
            height: 95px;
            padding: 30px 0 35px;
            -webkit-box-sizing: border-box;
            box-sizing: border-box
        }

        .pb-aside-right .qq-hover-banner {
            position: absolute;
            top: -53px;
            left: 0;
            width: 210px;
            height: 200px;
            padding: 2px 16px 0 18px;
            font-size: 12px;
            color: #666;
            background-color: #fff;
            -webkit-border-radius: 4px;
            border-radius: 4px;
            -webkit-box-shadow: 0 0 15px rgba(0, 0, 0, .1);
            box-shadow: 0 0 15px rgba(0, 0, 0, .1)

        .pb-aside-right .qq-hover-banner > ul > li {

            line-height: 20px;
            padding: 13px 0 5px;
            text-align: left;

            box-sizing: border-box
        }

            width: 44px;
            height: 100%;
            line-height: 18px;

            border-radius: 10px

            margin-top: 16px;
            color: #666

        .pb-bottom .content .icons1 {

        .pb-bottom .bot-list li:first-child {
